import React from 'react';
import NavBar from './navBar';
import { Link } from 'react-router-dom';

const home = () => {
  return (

    <NavBar>
      <Link to="/">
        <h1>
          Home
        </h1>
      </Link>
    </NavBar>

  )
};

export default home;
